import styled from "styled-components";

export const SWContainer = styled.div`
  height: 350px;
  width: 9000px;
  padding: 20px;
  background-color: #403d39;
`;

export const SWTitleContainer = styled.div`
  display: flex;
  padding: 5px;
  text-align: center;
  justify-content: center;
  align-items: center;

  font-size: 20px;
`;

export const SWTitleDiv1 = styled.div`
  width: 50%;
  font-weight: bold;
`;

export const SWTitleDiv2 = styled.div`
  flex-grow: 1;
`;

export const SWText = styled.text`
  align-items: center;
  text-decoration: none;
  color: inherit;
  font-size: 20px;
`;

export const SWText2 = styled.p`
  align-items: center;
  text-decoration: none;
  color: inherit;
  font-size: 18px;
  margin: 20px;
`;

export const SWBodyContainer = styled.div`
  text-align: center;
  display: flex;
  justify-content: center;
  align-items: center;
`;

export const SWBodyDiv1 = styled.div`
  float: left;
  width: 33.3%;
`;

export const SWBodyDiv2 = styled.div`
  float: left;
  width: 33.3%;
`;

export const SWBodyDiv3 = styled.div`
  float: right;
  width: 33.3%;
`;

export const SWBodyDiv4 = styled.div`
  margin-left: 25px;
`;
